// Create your Body component here
import React from 'react';
import { FaGithub, FaLinkedin } from 'react-icons/fa';

const Body = () => {
  return (
    <div id="home" className="body">
    <img src="../assets/avatar.jpg" alt="Profile Avatar" className="body-img"/>
      <div className="body-info">
        <h1 className="body-name">John Doe</h1>
        <p className="body-profession">Software Architect</p>
      </div>
      <div className="body-links">
        <a href="https://github.com/yourusername" className="social-link">
          <FaGithub className="social-icon" />
        </a>
        <a href="https://linkedin.com/in/yourusername" className="social-link">
          <FaLinkedin className="social-icon" />
        </a>
      </div>
    </div>
  );
};

export default Body;
